import React, { useState } from 'react';
import axios from 'axios';

const AdminDashboard = () => {
  const [formData, setFormData] = useState({
    imageUrl: '',
    brand: '',
    model: '',
    ram: '',
    storage: '',
    price: '',
    condition: '',
  });

  const handleChange = (e) => {
    setFormData((prev) => ({
      ...prev,
      [e.target.name]: e.target.value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem('admin_token');

    try {
      const res = await axios.post(
        'http://localhost:5000/api/mobiles/upload',
        formData,
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      alert('Mobile uploaded ‚úÖ');
      setFormData({
        imageUrl: '',
        brand: '',
        model: '',
        ram: '',
        storage: '',
        price: '',
        condition: '',
      });
    } catch (err) {
      alert('Upload failed ‚ùå');
      console.error(err);
    }
  };

  return (
    <div style={{ padding: '40px' }}>
      <h2>üì§ Upload New Mobile</h2>
      <form onSubmit={handleSubmit} style={{ maxWidth: '400px' }}>
        <input type="text" name="imageUrl" placeholder="Image URL" value={formData.imageUrl} onChange={handleChange} required /><br />
        <input type="text" name="brand" placeholder="Brand" value={formData.brand} onChange={handleChange} required /><br />
        <input type="text" name="model" placeholder="Model" value={formData.model} onChange={handleChange} required /><br />
        <input type="text" name="ram" placeholder="RAM (e.g., 4GB)" value={formData.ram} onChange={handleChange} /><br />
        <input type="text" name="storage" placeholder="Storage (e.g., 64GB)" value={formData.storage} onChange={handleChange} /><br />
        <input type="number" name="price" placeholder="Price" value={formData.price} onChange={handleChange} /><br />
        <input type="text" name="condition" placeholder="Condition (e.g., Good)" value={formData.condition} onChange={handleChange} /><br />
        <button type="submit">Upload</button>
      </form>
    </div>
  );
};

export default AdminDashboard;
